import React from "react";
import "./Page5.scss";
import page5SVG from "../../assets/page5SVG.svg";

export const Page5 = () => {
  return (
    <div className="page5">
      <div className="page5__inner">
        <div className="page5__svg">
          <img src={page5SVG} alt="page5SVG" />
        </div>
        <div className="page5__joinBlock">
          <div className=""></div>
        </div>
      </div>
    </div>
  );
};
